Com o PT, tivemos a Lei de Acesso à Informação (LAI);
Com Bolsonaro, temos a “Lei do Sigilo à Informação” (LSI); 
Transformar dados da PEC 6/2019, da “nova previdência” em informação sigilosa só reforça a falta de transparência no debate acerca do fim da aposentadoria.

Reforma da previdência de Bolsonaro e Guedes: 
- aumenta de 15 para 20 anos o tempo mínimo de contribuição; 
- trabalhadores pobres estão na informalidade e têm menor expectativa de vida; 
A morte vai chegar antes do direito de se aposentar. Isso é combater privilégio?

Nos itens 50 e 51 da proposta de reforma da previdência de Bolsonaro e Guedes são considerados:

"Ricos": grupo de trabalhadores que ganham em média R$ 2.251,00; 

"Pobres”: os que ganham R$ 1.251,00; 

"Rico" é quem ganha pouco mais de 2 salários mínimos?

E você ainda tem dúvida se a Reforma da Previdência é fundamental? 

